import React from 'react'

const ProjectCardData = (props) => {
  const { logo, count, name } = props.data;
  return (
    <div>
      <div className='ProjectCard'>
        <img src={logo} />
        </div>
        <div className='ProjectCard-details'>
          <p>{count}</p>
          <p>{name}</p>
        </div>

    </div>
  )
}

export default ProjectCardData;
